import logo from "./logo.svg";
import "./App.css";

import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

import HomeScreen from "./screens/HomeScreen";
import RoomsScreen from "./screens/RoomScreen";
import PhotoGalleryScreen from "./screens/PhotoGalleryScreen";
import LocationScreen from "./screens/LocationScreen";
import NearAroundScreen from "./screens/NearAroundScreen";
import ContactScreen from "./screens/ContactScreen";

function App() {
  return (
    <Router>
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/rooms">Rooms</Link>
          </li>
          <li>
            <Link to="/photo-gallery">Photo Gallery</Link>
          </li>
          <li>
            <Link to="/location">Location & Directions</Link>
          </li>
          <li>
            <Link to="/near-around">Near & Around Us</Link>
          </li>
          <li>
            <Link to="/contact">Contact Us</Link>
          </li>
        </ul>
      </nav>

      <Routes>
        <Route path="/" element={<HomeScreen />} />
        <Route path="/rooms" element={<RoomsScreen />} />
        <Route path="/photo-gallery" element={<PhotoGalleryScreen />} />
        <Route path="/location" element={<LocationScreen />} />
        <Route path="/near-around" element={<NearAroundScreen />} />
        <Route path="/contact" element={<ContactScreen />} />
      </Routes>
    </Router>
  );
}

export default App;
